import React from 'react';
import AboutMe from './AboutMe';
import './App.css';
import Home from './Home';
import { Link, animateScroll as scroll } from 'react-scroll';
import Footer from './Footer';
import Projects from './Projects';
import Languages from './Languages';



function App() {

  return (
    <div className='content-container'>
      <nav style={{display: 'flex,'}}>
        <Link to='home' spy={true} smooth={true}>Home</Link>
        <Link to='about' spy={true} smooth={true}>About Me</Link>
        <Link to='languages' spy={true} smooth={true}>Languages</Link>
        <Link to='portfolio' spy={true} smooth={true}>Portfolio</Link>
        <Link to='resume' spy={true} smooth={true}>Resume</Link>
      </nav>

      <Home id='home' />
      <AboutMe id='about' />
      <Languages id='languages' />
      <Projects id='portfolio' />
      <Footer />
    </div>
  )
}


export default App;
